const SignUp1 = () => {
  const [userType, setUserType] = useState(0)
  const [isDisabled, setIsDisabled] = useState(true)

  const handleSelect = (type) => {
    setUserType(type)
    setIsDisabled(false)
  }

  return (
    <div className='w-1/2 px-6 pt-12 pb-9 flex flex-col justify-between'>
      <div>
        <button className='w-10 h-10 mb-10 flex-center bg-stone-50 rounded-full'>
          <img src={AngleRight} alt="" />
        </button>

        <h1 className='mb-5 text-2xl font-medium'>Sign up</h1>
        <div className='grid gap-5'>
          <div 
            onClick={() => handleSelect(1)}
            className={`flex px-4 py-3 gap-5 group ${userType === 1 ? "text-white bg-neutral-500" : "hover:text-white hover:bg-neutral-500"} border border-black rounded-lg cursor-pointer`}>
            <img src={UserIcon} alt="" />
            <div>
              <p className='font-medium'>Individual</p>
              <p className={`text-sm ${userType === 1 ? "text-white" : "group-hover:text-white text-zinc-500"}`}>You want to register with Convey as an individual</p>            
            </div>
          </div>
          <div 
            onClick={() => handleSelect(2)}
            className={`flex px-4 py-3 gap-5 group ${userType === 2 ? "text-white bg-neutral-500" : "hover:text-white hover:bg-neutral-500"} border border-black rounded-lg cursor-pointer`}>
            <img src={TruckIcon} alt="" />
            <div>
              <p className='font-medium'>Company Rider</p>
              <p className={`text-sm ${userType === 2 ? "text-white" : "group-hover:text-white text-zinc-500"} `}>You work with a registered company as an individual</p>            
            </div>
          </div>
          <div 
            onClick={() => handleSelect(3)}
            className={`flex px-4 py-3 gap-5 group ${userType === 3 ? "text-white bg-neutral-500" : "hover:text-white hover:bg-neutral-500"} border border-black rounded-lg cursor-pointer`}>
            <img src={BuildingIcon} alt="" />
            <div>
              <p className='font-medium'>Company</p>
              <p className={`text-sm ${userType === 3 ? "text-white" : "group-hover:text-white text-zinc-500"}`}>You want to register with Convey as an individual</p>            
            </div>
          </div>
        </div>        
      </div>

      <Button text={"Proceed to Sign up"} isDisabled={isDisabled}/>
    </div>
  )
}

